import React from 'react';
import Header from './components/Header';
import { ThemeProvider } from 'styled-components';
import { Container } from './components/styled/Container.styled';

const theme = {
    color: {
        header: '#ebfbff',
        body: 'fff',
        footer: '#003333',
    },
};

const App = () => {
    return (
        <ThemeProvider theme={theme}>
            <Header />
            <Container>
                <h1>App</h1>
            </Container>
        </ThemeProvider>
    );
};

export default App;
